import './App.css';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link
} from "react-router-dom";

import React, { Component } from 'react'
import Navbar from './Components/Navbar';
import News from './Components/News';

export default class App extends Component {
  render() {
    return (
      <div>
        <Router>
          <Navbar />
          <Routes>
            <Route path="/" element={<News key="general" country="us" category="general" />}/>
            <Route path="/buisness" element={<News key="buisness" country="us" category="business" />} />
            <Route path="/entertainment" element={<News key="entertainment" country="us" category="entertainment" />} />
            <Route path="/helth">
              <News pageSize={6} country="us" category="helth"/>
            </Route>
            <Route path="/sports">
              <News pageSize={6} country="us" category="sports"/>
            </Route>
            <Route path="/technology">
              <News pageSize={6} country="us" category="technology"/>
            </Route>
        </Routes>
        </Router>
      </div>
    )
  }
}
